    - ASICS Gel-Lyte III Ronnie Fieg "Flamingo"
    - Over a year since his previous GL3 release, Ronnie Fieg brought back his creative
      expertise on one of his favorite ASICS models with the Ronnie Fieg x Asics Gel-Lyte
      III "Flamingo." Released in August of 2014, the Flamingo GLIII was an instant
      standout among his other works. Originally a 1-of-1 sample that he had created
      for himself back in 2009, at first RF was hesitant to release the Flamingo Gel
      Lytes to the world because of their untraditional color palette. Yet, after
      releasing a picture via social media and receiving an overwhelming response
      from the public, Ronnie finally felt as though it was time to add the Flamingo
      GEL Lyte 3 to his already extensive ASICS catalog. Inspired by the ashy color
      of flamingos' feathers, the apron and rear paneling are subtly pink-hued grey.
      The salmon striping through the mid-foot and the 3M hits on the toe box reflect
      the colors that flamingos turn after feasting on salmon. The blue lining on
      the Gel Lyte represents the water in which they prey and was the first time
      Fieg used thin neoprene material on a collaboration. Released alongside a handful
      of Japanese French terry apparel pieces, the Flamingo were priced at $150. After
      instantly selling out both in-store at Kith and online, the Ronnie Fieg x Asics
      Gel-Lyte III "Flamingo" is one of the most coveted shoes in a long line of successful
      Fieg collaborations.
