    - ASICS Gel-Lyte III Ronnie Fieg "Leatherbacks"
    - Adorned with a rich, grey suede toe box and nubuck apron, the Ronnie Fieg x
      Asics Gel-Lyte III "Leather back" were released on November 18th, 2011 as part
      of the Kith Manhattan Grand Opening. The Leatherbacks were available in 2 different
      packages, one which retailed for $200, while the other just $130. The first
      package contained the Leather backs GL3, an American-made Kith x ASICS shirt,
      and wooden dog tags inside a laser engraved and numbered wooden box, of which
      only 40 were made. The second package contained only the Leather Back GLIII
      and was available to those who were not able to purchase the special packaging
      in-store and to those who made their purchase online. The Leatherback Gel Lytes
      were a shift in Ronnie's work from using bright color palettes to darker, more
      robust hues. Shadowing the GEL-Lyte IIIs that came before this, the Salmon Toes,
      the Leather Backs were almost the mirror opposite with their dark undertones.
      Using premium leather that was meant to survive the frosty winters in New York,
      RF selected electric blue accents to breakup the darker tones of the mid and
      rear panelling almost like neon lights cutting through the city skyline. Even
      years after their release, the Ronnie Fieg x Asics Gel-Lye III "Leather back"
      is one of the most heralded releases from Kith and is extremely sough-after
      by collectors the world over.
