    - ASICS Gel-Lyte III Ronnie Fieg "Mint Leaf"
    - 'Following his 2010 release of the "Cove" GL3, Ronnie again created a piece
      that is almost synonymous with his name: the Ronnie Fieg x Asics Gel-Lyte III
      "Mint Leaf." As a child, RF would visit family in Israel annually, and their
      family would drink fresh mint-infused tea together. Fieg was in-charge of picking
      the mint leaves off the branches from his grandmother''s garden, eventually
      earning himself the nickname "Minty." And although no longer a young boy, those
      experiences from his childhood impacted him enough to inspire the GEL Lyte 3
      "Mint Leaf." Using a vibrant green nubuck as the upper apron and rear panel,
      with a mesh toe and split tongue, the Mint GLIII used his signature monochromatic
      coloring against a light-grey midsole with darker grey accents. Released in
      July of 2011, before RF''s store Kith was opened, the Mint GEL-Lyte 3 proved
      to be Ronnie''s last release at David Z and retailed for $120. In the years
      following their release, the Ronnie Fieg x Asics Gel-Lyte III "Mint Leaf" proved
      to withstand the test of time. So much so, that in 2014 RF did another rendition
      of the colorway set across the ASICS Gel-Lyte V model giving those who had thirsted
      for the shoe for nearly three years an opportunity to add the colorway to their
      collections.'
